(12, 184, 'default_3x3', '', 'Credit Furni', 1, 146, 1, 1, 0, '1', '1', '0', '0', 'catalog_bank_headline1', 'credit_exchange', '', 'Habbo Exchange is where you can convert your Credits into a tradable currency. You can then use this currency to trade for Furni or just show off your riches in your room.', '', '', '', ''),
(566, 5, 'pets3', '', 'Building Furni', 1, 263, 1, 0, 0, '1', '1', '0', '0', 'catalog_header_roombuilder', 'ctlg_bclub_note', '', '', 'Habbobba Building Furni', 'Here you have it Habbos..\r\n\r\nWe have taken the time to sort out our room building furni.\r\n\r\nWhy you say?\r\n\r\nWell we want it to be as easy to find what tools you need for what ever building job you find yourself in.\r\n\r\nThis makes it easy for us to find and search up what tools you\'re looking for to make room building less painful!\r\n\r\nAre we missing something is something broken?\r\n\r\nPlease report any issues with our catalogue to the staff!', '', ''),
(2, -1, 'default_3x3', 'furni', 'Furni', 1, 263, 1, 2, 0, '1', '1', '0', '0', 'catalog_header_roombuilder', 'cr_infopic3', '', '', 'Habbobba Furni Shop', 'Habbobba Hotel always has the most up to date furni and latest features!\r\n\r\nYou can browse are huge selection of furni in a smooth and sorted order!\r\n\r\nOur furni is sorted and based off facts found on www.habboxwiki.com\r\n\r\nFind appropriate names and furni categories by the name or year of the furni!\r\n\r\nAll broken or missing furni and misspelled furni names are easily fixed.\r\n\r\nIf you find any issues related to our furni please let a staff member know!\r\n\r\nWith the help of the community we can all work towards always improving this catalogue.\r\n\r\nHabbobba Hotel - (2018-2019)', '', ''),
(13, 5, 'spaces_new', '', 'Spaces', 1, 225, 1, 13, 0, '1', '1', '0', '0', 'catalog_spaces_headline1_uk', '', '', '', '', '', '', ''),
