(281, 568, 'default_3x3', '', 'Area', 1, 14, 1, 1, 0, '1', '1', '0', '0', 'catalog_area_headline1', 'catalog_area_teaser1', '', 'A chunky and sofisticated line for the down-to-earth, It\'s simplicty is beautful and will add a welcoming charm to every room.', '', '', '', ''),
