(24, 209, 'default_3x3', '', 'Base', 1, 179, 1, 9, 0, '1', '1', '0', '0', 'catalog_header_base', 'base_rentable_teaser', '', 'This colourful range of furni has everything you need to style out your room and build great spaces.', '', '', '', ''),
(299, 376, 'default_3x3', '', 'Valentines - 2014 - Health Spa', 1, 53, 1, 9, 0, '1', '1', '0', '0', 'catalog_header_spa', 'catalog_teaser_spa', '', 'A day at the spa! Inhale...Exhale...Inhale...Exhale. With all the features of a premium Spa, you can now create your very own Wulles Health Spa relaxing retreat! Robe and slippers not included.', '', '', '', ''),
(25, 5, 'badge_display', '', 'Badge Display', 1, 224, 1, 3, 0, '1', '1', '0', '0', 'catalog_header_badgedisplay', 'badgedisplay_promo2', '', 'You worked hard to get your badges, right? Now\'s the time to show it off, grab a display case and choose your favorite badge to show off!', '', '', '', ''),
(26, 2, 'roomads', 'room_event', 'Room Event', 1, 27, 1, 14, 0, '1', '1', '0', '0', 'events_header', '', '', '', '', '', '', ''),
(27, 568, 'default_3x3', '', 'Iced', 1, 35, 1, 4, 0, '1', '1', '0', '0', 'catalog_iced_headline1', 'catalog_iced_teaser1', '', 'The Iced range: Squishy, soft and most definitely cool. Whatever your needs, this stylish range should cover it!', '', '', '', ''),
(28, 209, 'default_3x3', '', 'Alhambra', 1, 11, 1, 3, 0, '1', '1', '0', '0', 'alhambra_header', 'alhambra_teaser', '', 'For the cold Arabian nights and hot Arabian days, you\'ll need a palace.. And we have just what you need! Green blossom print should cover it just fine!', '', '', '', ''),
(302, 461, 'default_3x3', '', 'Asian', 1, 13, 1, 1, 0, '1', '1', '0', '0', 'catalog_asian_headline1', 'catalog_asian_teaser1', '', 'Ting tong! Ching chong? Ting chong ting, ping ping! I mean uh.. with our authentic Chinese furniture, you can make a beautiful oriental room!', '', '', '', ''),
(303, 209, 'default_3x3', '', 'Bensalem', 1, 18, 1, 11, 0, '1', '1', '0', '0', 'catalog_lc_headline2_en', 'catalog_lc_teaser1_en_001', '', 'Glub... glub... glub...', '', '', '', ''),
(304, 209, 'default_3x3', '', 'Executive', 1, 27, 1, 28, 0, '1', '1', '0', '0', 'catalog_exe_headline1_en', 'catalog_exe_teaser_en', '', 'For the ultimate business man, the Executive range with its leather seats and Italian coffee is a dream! How about you try the easy lifestyle?', '', '', '', ''),
(29, 209, 'default_3x3', '', 'Glass', 1, 29, 1, 31, 0, '1', '1', '0', '0', 'catalog_glass_headline1', 'catalog_glass_teaser1', '', 'You can really open up a space with this stylish glass furniture, just don\'t walk into it!', '', '', '', ''),
(30, 209, 'default_3x3', '', 'Gothic', 1, 17, 1, 32, 0, '1', '1', '0', '0', 'catalog_gothic_headline1', 'catalog_gothic_teaser1', '', 'As the church bells ring out midnight, you walk through your cobbled hall lit by candles, throw yourself into your medieval throne and paint your nails black. This is what we imagined when we ordered this range!', '', '', '', ''),
(31, 209, 'default_3x3', '', 'Japan', 1, 19, 1, 44, 0, '1', '1', '0', '0', 'catalog_jap_headline1', 'catalog_jap_teaser3_en', '', 'We have sushi, tatami and katana\'s! I have no idea what the difference is, but I sure know its Japanese! Fulfil your fantasies and buy some today!', '', '', '', ''),
(32, 209, 'default_3x3', '', 'Lost Tribe', 1, 38, 1, 50, 0, '1', '1', '0', '0', 'losttribe', 'LT_teaser_en', '', 'Start your own tribal village with our ancient furniture, all carved from hard wearing stone. NOTE: Lava is hot, get an adult to help you.', '', '', '', ''),
(33, 209, 'default_3x3', '', 'Neon', 1, 21, 1, 28, 0, '1', '1', '0', '0', 'catalog_neon_header1_en', 'catalog_neon_teaser1_en', '', 'New years eve, birthdays and every other day of the year, there\'s always an excuse for a party! So, why don\'t you buy some Neon furni!?', '', '', '', ''),
(34, 209, 'default_3x3', '', 'Relax', 1, 49, 1, 70, 0, '1', '1', '0', '0', 'rela_header_en', 'rela_teaser_en', '', 'Relax after a busy day in the Welcome Lounge. Light a few candles, and chill out with a good read in a wicker chair. We understand the needs of a Wulles with a hectic lifestyle!', '', '', '', ''),
(35, 209, 'default_3x3', '', 'Romantique', 1, 50, 1, 34, 0, '1', '1', '0', '0', 'catalog_romantique_headline1', 'catalog_rom_teaser_en', '', 'Found in a French barn, this sweet but sexily romantic range caters to every ladies needs. Just going to powder my nose!', '', '', '', ''),
(36, 209, 'default_3x3', '', 'Scifi', 1, 26, 1, 37, 0, '1', '1', '0', '0', 'sf_header_en', 'sf_teaser_en', '', 'Sci Fi convention, outer space, the Moon, we have everything you need to make your own mystical, un-earthly room right here!', '', '', '', ''),
