(570, 263, 'default_3x3', '16', 'Bonus Bag I - 2019', 1, 42, 5, 4, 0, '1', '1', '0', '0', 'Stars_header', 'Spromo_Bonus_Bags', '', 'Please use these as awards for players for playing events and games on our hotel.\nDo not abuse the ability to give our rewards to the guests of our hotel.\nYour trade logs are logged and monitored at all times.\n(Includes All Staff Team!)', '', '', '', ''),
