(227, 219, 'pets2', '', 'How to play Banzai', 1, 42, 1, 1, 0, '1', '1', '0', '0', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', '', 'So how does it work? Read the instructions here and you\'ll be Banzai-ing in no time!', 'How to create your own \nBattle Banzai Arena:', '1. In your room, place Banzai tiles on the floor and barriers the playing field\r\n\r\n2. Add a Team portal for each team (max 4: blue,\r\npink, yellow, and green)\r\n \r\n3. Place a Counter and Scoreboards on the playing field\r\n\r\n4. Click the Counter to launch the game!\r\n\r\n5.Jump on the tiles to color them, jump 3 times to lock - team with most points win!\r\n\r\n\r\n\r\n\r\nTip: Add drama with Pyramids, Dragons and Pucks - they work as obstacles and helpers!', '', ''),
