(228, 219, 'pets2', '', 'How to play Freeze', 1, 42, 1, 3, 0, '1', '1', '0', '0', 'catalog_freeze_en', 'ctlg_pet_note', '', 'Find out how you can make and host your own Freeze! game by reading the instructions below!', 'How to play Freeze!', '1. Place Tiles and Blocks in your room. Always place blocks on top of tiles! Add Team Gates, a Counter, an Exit Tile and Scoreboards.\n\n2. Ready? Let your friends choose a team. Each team can have up to five players. Then click the Counter\nto start!\n \n3. To place a Snowball, double click on the tile that you are standing on, or double click on a tile next to you. Blow up Blocks for power-ups!\n\n4. Last team standing wins!\n\n\n\n\nRemember: You will be warped to an Exit Tile when you lose all your lives.', '', ''),
