(102, 277, 'single_bundle', 'velociraptor_pet', 'Velociraptor', 1, 260, 1, 17, 0, '1', '1', '0', '0', 'jurassic15_catalog_header', 'dino_pets', '', 'Swift and sneaky, these reptiles have a reputation for being somewhat high-maintenance, incredibly intellectual and endlessly troublesome! You\'ll often find them pondering over deeply philosophical questions, or enjoying the finer things in life, like pedicures and meat straight off the bone.', '', '', '', ''),
(232, 277, 'single_bundle', 'pterodactyl_pet', 'Pterodactyl', 1, 260, 1, 29, 0, '1', '1', '0', '0', 'jurassic15_catalog_header', 'dino_pets', '', 'These pterrific pets have a fierce appearance with long talons and sharp teeth, but their sweet nature always shines through! Ultra laid-back, these \'flying lizards\' love nothing more than spending time with their owner, soaring through the Hotel skies and eating their favourite food...the humble kale leaf.', '', '', '', ''),
