(246, 4, 'pets3', '', 'Monster Plants', 1, 153, 1, 5, 0, '1', '1', '0', '0', 'catalog_header_mopla_01', 'ctlg_monster_note', '', 'Monster Plants can sure be a handful, this page gives you some extra advice on raising and looking after your monsterous brood.', 'Taking Care Of Your Plant', 'Your plants need to be tended regularly, or else they die. To ensure a healthy plant tend it every 30 hours\nor so. If it dies, you can use the Revival potion to\nbring it back to life.\nBreeding\nTo breed your plant you have to wait until it\'s fully\ngrown. Clicking Breed on the menu will show you\nwhat other plants in the room are available to breed\nwith.', '', ''),
